import React, { Component } from 'react'

class Join extends Component {
  render() {
    return (
      <section className="join">
        <p className="join__text">If you want to join the team, get in touchor have any inquiries about distribution, alliancesor special projects, please contact us at: <a href="mailto:info@carnemag.co">info@carnemag.co</a></p>
      </section>
    )
  }
}

export default Join
